describe("timeCalculator Service",function(){var e;beforeEach(angular.mock.module("BTApp"));var t={time:"12:30:00",day:2};beforeEach(inject(function(t){e=t})),it("should exist",function(){expect(e).toBeDefined()}),it("convertDateTimeObjToNumber should return min",inject(function(e){expect(e.convertDateTimeObjToNumber(t,"mins")).toEqual(3630)})),it("convertDateTimeObjToNumber should return Hrs",inject(function(e){expect(e.convertDateTimeObjToNumber(t,"hrs")).toEqual(60.5)})),it("convertDateTimeObjToNumber should return days",inject(function(e){expect(e.convertDateTimeObjToNumber(t,"days")).toEqual(2.5208333333333335)}))});